import React, { Component } from 'react';
import './App.css';
import Header from './Header';
import PersonalProfile from './PersonalProfile';
import WorkExperience from './WorkExperience';
import Skills from './Skills';
import Education from './Education';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: 'Zh Rimel',
      contactInfo: {
        email: 'abc@gmail.com',
        website: 'abc.github.io/abc',
        phone: '01234567890',
      },
      profile: `Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do 
      eiusmod tempor incididunt ut labore et dolore magna aliqua.`,
      workExperience: [
        {
          jobTitle: 'Job Title at Company',
          date: 'August 2022 – December 2023',
          description: `Lorem ipsum dolor sit amet, consectetur adipiscing elit.`,
          keySkills: ['Key skill 1', 'Key skill 2', 'Key skill 3'],
        },
        {
          jobTitle: 'Job Title 2 at Company 2',
          date: 'August 2020 – December 2021',
          description: `Lorem ipsum dolor sit amet, consectetur adipiscing elit.`,
          keySkills: ['Key skill A', 'Key skill B', 'Key skill C'],
        },
      ],
      skills: ['Skill 1', 'Skill 2', 'Skill 3'],
      education: [
        {
          degree: 'BS in Computer Science',
          year: '2018 - 2022',
          gpa: '3.9',
          institution: 'New Jersey Institute of Technology',
        },
        {
          degree: 'MS in Data Science',
          year: '2022 - 2023',
          gpa: '4.0',
          institution: 'New Jersey Institute of Technology',
        }
      ]
    };
  }

  render() {
    return (
      <div className="App">
        <Header name={this.state.name} contactInfo={this.state.contactInfo} />
        <PersonalProfile profile={this.state.profile} />
        <WorkExperience experiences={this.state.workExperience} />
        <Skills skills={this.state.skills} />
        <Education education={this.state.education} />
      </div>
    );
  }
}

export default App;
